from typing import List

def count_enclosed_land_cells(grid: List[List[int]]) -> int:
    num_ones = 1
    ones = []
    visited = set()
    n = len(grid)
    m = len(grid[0])
    for i in range(n):
        for j in range(m):
            if grid[i][j] == 1:
                num_ones += 1
                if i == 0 or i == n - 1 or j == 0 or (j == m - 1):
                    ones.append((i, j))
                    visited.add((i, j))
    while ones:
        x = ones.pop(0)
        num_ones -= 1
        (a1, a2) = x
        for (dx, dy) in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
            (ni, nj) = (a1 + dx, a2 + dy)
            if 0 <= ni < n and 0 <= nj < m and (grid[ni][nj] == 1) and ((ni, nj) not in visited):
                ones.append((ni, nj))
                visited.add((ni, nj))
    return num_ones

